// Hack to get less var
var getLessVar = function (name, prop) {
  var value = $('<div class="' + name + '"></div>').hide().appendTo('body').css(prop)
  $('.' + name).remove()
  return /^\d+/.test(value) ? +value : value
}

//
// Wiggly graph, kind of the website signature !
//
var Graphy = (function() {
  var holder = $('#holder');
  var w = holder.width();
  var h = holder.height();
  var r = Raphael("holder", w, h);
  var padding = 5;
  var bg = r.path();
  var refreshIntervalId;

  function randomPath() {
    var length = Math.round(w/8);
    var path = "";
    var   x = 0;

    for (var i = 0; i < length; i++) {
        curY = Math.round(Math.random() * (h-padding));
        if(i==0){
            path = "M"+0+","+curY;
        }else{
            x += Math.round(w/length);
            path += "," + [x, curY];
        }
    }
    return path;
  }

  function animation(time) {
        var anim = Raphael.animation({path: randomPath()}, time, "linear");
        bg.animate(anim);
    }

return {
    animate :function (time) {
        animation(time);
    },startLoading : function(time){
        refreshIntervalId = setInterval(function(){animation(time)}, time+5);
    },stopLoading : function(){
        clearInterval(refreshIntervalId);
    },init : function(){
        // First draw
        bg.attr({path: randomPath(),stroke:getLessVar('myColor', 'color'), opacity: 1, fill:"none"});

        // Nice effect on hover
        holder.hover(
         function () {
           Graphy.startLoading(150);
         },
         function () {
           Graphy.stopLoading();
         }
     );
    }
};
})();


Graphy.init();
;'use strict';

var myApp = angular.module('myApp', ['ng', 'seo']);

// routes
myApp.config(function ($routeProvider,$locationProvider){
  $locationProvider.hashPrefix('!');
  //$locationProvider.html5Mode(true);
  $routeProvider
  .when('/lab',{
    controller:'LabController',
    templateUrl:'app/partials/lab.html'
  })
  .when('/scribbles',{
    controller:'ScribblesController',
    templateUrl:'app/partials/scribbles.html'
  })
  .when('/scribble/:slug',{
    controller:'ScribblesController',
    templateUrl:'app/partials/scribble.html'
  })
  .when('/contact',{
    controller:'MainController',
    templateUrl:'app/partials/contact.html'
  })
  .when('/',{
    controller:'MainController',
    templateUrl:'app/partials/me.html'
  })
  .otherwise({redirectTo:'/'});
});;'use strict';

myApp.controller('AppController', function($scope, $location) {

	$scope.slug = function(text) {
			return text
			.toLowerCase()
			.replace(/[^\w ]+/g,'')
			.replace(/ +/g,'-')
			;
		};

		$scope.routeIs = function(routeName) {
			return $location.path() === routeName;
		};

		$scope.menus =
		[{link:"", icon:"user"},
		{link:"lab", icon:"beaker"},
		{link:"scribbles", icon:"bookmark"},
		{link:"contact", icon:"envelope-alt"}];

	});;'use strict';

